PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Asset" (
    "assetID" TEXT NOT NULL PRIMARY KEY,
    "txtStation" TEXT NOT NULL,
    "txtDesc" TEXT,
    "txtCode" TEXT NOT NULL,
    "txtMediaGroup" TEXT NOT NULL,
    "txtMediaSubGroup" TEXT NOT NULL,
    "kodetitik" TEXT,
    "lnkMockup" TEXT,
    "numvisualW" TEXT,
    "numvisualH" TEXT,
    "numvisualSQM" TEXT,
    "numsizeW" TEXT,
    "numsizeH" TEXT,
    "numsizeD" TEXT,
    "numsizeSQM" TEXT,
    "numweightmedia" TEXT,
    "numweightstructure" TEXT,
    "numpoweract" TEXT,
    "numpowerest" TEXT,
    "txtpixelpitch" TEXT,
    "txtnotes" TEXT,
    "stsActive" BOOLEAN NOT NULL,
    "lnkTemplate" TEXT,
    "txtlevel" TEXT
);
CREATE TABLE RentDetail (
	rentid INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	assetID TEXT NOT NULL,
	clientID INTEGER NOT NULL,
	datestart TEXT NOT NULL,
	dateend TEXT NOT NULL,
	txtsales TEXT,
	lnkreport TEXT,
	txtnotes TEXT,
	CONSTRAINT RentDetail_assetID_fkey FOREIGN KEY (assetID) REFERENCES Asset(assetID) ON DELETE RESTRICT ON UPDATE CASCADE,
	CONSTRAINT RentDetail_clientID_fkey FOREIGN KEY (clientID) REFERENCES Client(clientID) ON DELETE RESTRICT ON UPDATE CASCADE
);
CREATE TABLE Client (
	clientID INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	txtClient TEXT NOT NULL,
	txtCompany TEXT,
	txtPhone TEXT,
	txtAddress TEXT
);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "Asset_assetID_key" ON "Asset"("assetID");
CREATE UNIQUE INDEX "Client_clientID_key" ON "Client"("clientID");
CREATE UNIQUE INDEX "RentDetail_rentid_key" ON "RentDetail"("rentid");
COMMIT;
